How do I handle Many-To-One Relationships with Spring Boot + MongoDB<p>I'm learning how to use MongoDB with spring boot (Spring data MondoDB).</p>
<p>In my current code base that uses PostgreSQL, I have an API <code>GET /api/orders/238392</code>, which returns a model as follows:</p>
<pre><code>{
    &quot;orderId&quot;:238392,
    &quot;status&quot;:&quot;FULFILLED&quot;,
    &quot;senNumber&quot;:&quot;AB8893920&quot;,
    &quot;customer&quot;:{
        &quot;customerId&quot;:&quot;lskj2409023471lskdjflsf&quot;,
        &quot;name&quot;:&quot;John Doe&quot;,
        &quot;email&quot;:&quot;john.doe@acme.com&quot;,
        &quot;phoneNumber&quot;:&quot;7326585306&quot;,
        &quot;city&quot;:&quot;Los Angeles&quot;
    }
}
</code></pre>
<p>I now want to implement this user-case with MongoDB in the backend. This is my model</p>
<pre><code>// Orders.java
@Data
@Document
public class Order {
    @Id
    private Long orderId;
    private String status;
    private String senNumber;
    private Customer customer;
}


//Customer.java
@Data
@Document
public class Customer {
    @Id
    private String customerId;
    private String name;
    private String email;
    private String phoneNumber;
    private String city;
}
</code></pre>
<p>My API now works fine. However, I have a problem with the relationship between Orders and Customers.
In a relational world, I had the <code>@ManyToOne</code> on <code>customer</code>, as follows:</p>
<pre><code>@ManyToOne
private Customer customer;
</code></pre>
<p>I cannot do this in Mongo (that's where I need help).</p>
<p>Now, to my question. I have two collections - <strong>Customer</strong> and <strong>Order</strong>. Both of them have CRUD APIs. How do I handle a ManyToOne relationship between Order and Customer.</p>
<p><em><strong>If a user updates some properties of a Customer (name, email, etc), how does that change reflect in the Orders document?</strong></em></p>
<p>I have the following options that come to my mind:</p>
<ol>
<li>When I update a customer, I can update all the order documents with the new customer details (this doesn't seem correct - might cause a lot of performance overhead, i feel)</li>
<li>Using something like <code>@DbRef</code> - if that's the case, can I get some links to related documents or references.</li>
<li>Came across a library called <code>RelMongo</code> that allows you to use <code>@ManyToOne</code> annotations just like how you would in a relational world.</li>
</ol>
<p>This could be a simple <em>best-practices</em> question, I'm not sure. However, any help goes a long way to improve my understanding!!</p>
<p>Thanks,
Sriram</p>

